import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Home from '../Pages/Home';
import AboutMe from '../Pages/AboutMe';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" component={<Home/>} />
        <Route exact path="/about" component={<AboutMe/>} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
